import React from 'react';

import { Paper, Card } from '@mui/material';

export default function Webcams(props) {
   return (
      <Paper style={{ display: 'flex-wrap', }}>
         {props.webcams.map(cam => {
            return (
               <Card sx={{ maxWidth: 300 }}>
                  <img src={cam.image} />
               </Card>
            )
         })}
      </Paper>
   );
}
